import styled from 'styled-components';

export const Select = styled.select`
    border: 1px solid #e8e8e8;
    box-sizing: border-box;
    border-radius: 25px;
    padding: 0.3rem 0.6rem;
    color: #8d8d8d;

    &:focus {
      border: 1px solid #63b55c;
      border-radius: 25.2271px;
      outline: none;
    }
`;
